import React from 'react';
import './Calculator.css';
import Result from '../Result/Result';
import InputOne from '../InputOne/InputOne'; 
import InputTwo from '../InputTwo/InputTwo'; 
import ComputeButton from '../ComputeButton/ComputeButton';
import Operation from '../Operation/Operation';
import LastTwoOperations from '../LastTwoOperations/LastTwoOperations';


const Calculator = () => {

    return(
        <div class="calculatorContainer"> 
            <div class="Calculator"> 
            <Result> </Result>
                 <div className="first"> 
                    <InputOne/> 
                    <InputTwo/> 
                    <ComputeButton/> 
                </div>
                <div className="operationsContainer"> 
                    <Operation click={() => this.addition()} choice="addition" /> 
                    <Operation click={() => this.division()} choice="division"/> 
                    <LastTwoOperations click={() => this.addition()} choice="addition" /> 
                    </div>
                    <div className="operationsContainer"> 
                    <Operation /> 
                    <Operation/>  
                    <LastTwoOperations/>
                    </div>

                    </div>

        </div>
    )
}

export default Calculator;
